    <script>
        // https://osu.ppy.sh/wiki/en/Client/File_formats/osu_%28file_format%29
        class Map{
            // GENERAL
            audioFilename;
            previewTime;

            // METADATA
            title;
            titleUnicode;
            artist;
            artistUnicode;
            creator;
            version;
            source;
            tags;
            beatmapId;
            beatmapSetId;

            // DIFFICULTY
            hpDrainRate;
            od;
            sliderMultiplier;
            sliderTickRate;

            // EVENTS
            bgFilename;

            // TIMING POINTS
            timingPointsArray;

            // HIT OBJECTS
            hitObjectsArray;

            constructor (
                audioFilename, previewTime,
                title, titleUnicode, artist, artistUnicode, creator, version, source, tags, beatmapId, beatmapSetId,
                hpDrainRate, od, sliderMultiplier, sliderTickRate,
                bgFilename, timingPointsArray, hitObjectsArray
            ) {
                // GENERAL
                this.audioFilename = audioFilename;
                this.previewTime = previewTime;

                // METADATA
                this.title = title;
                this.titleUnicode = titleUnicode;
                this.artist = artist;
                this.artistUnicode = artistUnicode;
                this.creator = creator;
                this.version = version;
                this.source = source;
                this.tags = tags;
                this.beatmapId = beatmapId;
                this.beatmapSetId = beatmapSetId;

                // DIFFICULTY
                this.hpDrainRate = hpDrainRate;
                this.od = od;
                this.sliderMultiplier = sliderMultiplier;
                this.sliderTickRate = sliderTickRate;

                // EVENTS
                this.bgFilename = bgFilename;

                // TIMING POINTS
                this.timingPointsArray = timingPointsArray;

                // HIT OBJECTS
                this.hitObjectsArray = hitObjectsArray;
            }
        }

        class Note{
            static count = 0;
            
            disabled; isNext; // other properties

            #durationMs; #type; #sv; #bpm; #volume; // constructor generated properties

            #id; #divZIndex; #zeroPositionPx; #totalLengthPx; // predefined properties

            constructor(type, sv, bpm, offset, volume){
                // set properties
                this.#type = type;
                this.#sv = sv;
                this.#bpm = bpm;
                this.#durationMs = offset;
                this.#volume = volume;

                this.disabled = false;
                this.#id = `note${this.constructor.count}`;
                this.#divZIndex = this.constructor.count;
                let svMultiplier = this.#sv*this.#bpm/300; // divided by 300 for note spacing
                this.#zeroPositionPx = 0; // cursor position offset
                this.#totalLengthPx = this.#durationMs*svMultiplier;

                this.constructor.count++;
            }

            create(){
                // create instance in HTML
                let noteDiv = document.createElement("div");
                // div id
                noteDiv.id = this.#id;
                // div classes
                noteDiv.classList.add("circle");
                noteDiv.classList.add("note");
                noteDiv.classList.add(this.getType());
                // z-index
                noteDiv.style.zIndex = 99999 - this.#divZIndex; // 99999 should be changed to a "length of notes" variable
                document.getElementById("notes").appendChild(noteDiv);

                // set initial position
                this.#setPosition(this.#totalLengthPx);
            }
            
            move() {
                if(this.disabled) return;

                let percentage = getElapsedMs()/this.#durationMs;
                let lengthPx = this.#totalLengthPx;

                let posPx = lengthPx - (lengthPx*percentage) + this.#zeroPositionPx;
                this.#setPosition(posPx);
                
                let hitErrorMs = getElapsedMs() - this.#durationMs;
                if(hitErrorMs > ODinMs50) {
                    this.#setPosition(this.#zeroPositionPx);
                    new Feedback(0);
                    this.#setDisabled();
                }
            }

            hit(isDon){
                let hitErrorMs = getElapsedMs() - this.#durationMs;

                let feedbackColor = "black";
                let feedbackNumber = 0;
                let isHitColorRight;

                if(this.getIsDon() != isDon){
                    isHitColorRight = false;
                } else isHitColorRight = true;

                // SET FEEDBACK

                // HIT 100% (GREAT)
                if(isHitColorRight && (hitErrorMs <= ODinMs100 && hitErrorMs >= -ODinMs100)) {
                    feedbackColor = "white";
                    feedbackNumber = 1;
                }

                // HIT 50% (OK)
                else if(isHitColorRight && (hitErrorMs <= ODinMs50 && hitErrorMs >= -ODinMs50) ) {
                    feedbackColor = "green";
                    feedbackNumber = 2;
                }

                // MISS
                else if (hitErrorMs <= ODinMsMiss && hitErrorMs >= -ODinMsMiss) {
                    feedbackColor = "red";
                    feedbackNumber = 3;
                }
                
                // CREATE FEEDBACK
                if(feedbackNumber != 0) {
                    console.log("%chitErrorMs: "+hitErrorMs+" ms", "color: "+feedbackColor+";");
                    new Feedback(feedbackNumber);
                    this.#setDisabled();
                }
            }

            #setPosition(pos){
                pos = pos + globalOffsetPx;
                document.getElementById(this.#id).style.left = `${pos}px`;
            }

            #setDisabled(){ this.disabled = true; document.getElementById(this.#id).remove(); }
            
            getId(){ return this.#id; }
            getSV(){ return this.#sv; }
            getType(){ return (this.#type == 0 ? "don" : "katsu"); }
            getIsDon(){ return (this.#type == 0 ? true : false); }
            getOffset(){ return this.#durationMs; }
        }
        
        function convertMap() {
            let noteStringArray = document.getElementById("mapText").innerHTML.split('\n');
            let noteArray = [];

            let tempSV = 1;
            let bpm = 200;

            noteStringArray.forEach(noteString => {
                if(noteString.length > 5){
                    let holder = noteString.split(',');
                    let tempType = holder[4];
                    let tempOffset = holder[2];
                    noteArray.push(new Note(tempType, tempSV, tempBpm, tempOffset));    
                }
            });
            
            console.log(noteArray);
        }

        function convertMapV2() {
            let tempString = document.getElementById("mapText").innerHTML;
            let beatmapObj = {};

            

            // GET PROPERTIES FROM STRING

            // GENERAL
            let generalProperties = tempString.split("[General]")[1].split("[")[0].trim();
            beatmapObj.audioFilename = getBeatmapProperty("AudioFilename:", tempString);
            beatmapObj.previewTime = getBeatmapProperty("PreviewTime:", tempString);
            beatmapObj.mode = getBeatmapProperty("Mode:", tempString);

            // METADATA
            beatmapObj.title = getBeatmapProperty("Title:", tempString);
            beatmapObj.titleUnicode = getBeatmapProperty("TitleUnicode:", tempString);
            beatmapObj.artist = getBeatmapProperty("Artist:", tempString);
            beatmapObj.artistUnicode = getBeatmapProperty("ArtistUnicode:", tempString);
            beatmapObj.creator = getBeatmapProperty("Creator:", tempString);
            beatmapObj.diffName = getBeatmapProperty("Version:", tempString);
            beatmapObj.source = getBeatmapProperty("Source:", tempString);
            beatmapObj.tags = getBeatmapProperty("Tags:", tempString);
            beatmapObj.beatmapId = getBeatmapProperty("BeatmapID:", tempString);
            beatmapObj.beatmapSetId = getBeatmapProperty("BeatmapSetID:", tempString);
            
            // DIFFICULTY
            beatmapObj.hp = getBeatmapProperty("HPDrainRate:", tempString);
            beatmapObj.od = getBeatmapProperty("OverallDifficulty:", tempString);
            beatmapObj.sliderMultiplier = getBeatmapProperty("SliderMultiplier:", tempString);
            beatmapObj.sliderTickRate = getBeatmapProperty("SliderTickRate:", tempString);

            // EVENTS
            beatmapObj.bgReferenceString = tempString
            .split("[Events]")[1]
            .split("//Background and Video events")[1]
            .split(`"`)[1]
            .trim();

            // TIMING POINTS & HIT OBJECTS
            let timingPointsString = tempString
            .split("[TimingPoints]")[1]
            .split(`[`)[0]
            .trim();
            let hitObjectsString = tempString
            .split("[HitObjects]")[1]
            .split(`[`)[0]
            .trim();
            
            let timingPointsStringArray = timingPointsString.split("\n");
            let uninheritedArray = [];
            let inheritedArray = [];
            
            // https://osu.ppy.sh/wiki/en/Client/File_formats/osu_%28file_format%29#timing-points
            timingPointsStringArray.forEach(timingPointString => {
                if(timingPointString.length > 5){
                    let tempTimingPointsObj = {};
                    let holder = timingPointString.split(',');

                    let tempUninherited = holder[6];
                    let tempBpm = 1/holder[1]*1000*60;
                    let tempSv = 1/(-holder[1])*100;

                    tempTimingPointsObj.offset = parseInt(holder[0]);
                    if(tempUninherited == 1){ tempTimingPointsObj.bpm = tempBpm; }
                    else{ tempTimingPointsObj.sv = parseFloat(tempSv); }
                    tempTimingPointsObj.meter = holder[2];
                    tempTimingPointsObj.volume = parseFloat(holder[5]);
                    tempTimingPointsObj.effects = holder[7];

                    if(tempUninherited == 1){ uninheritedArray.push(tempTimingPointsObj); }
                    else{ inheritedArray.push(tempTimingPointsObj); }
                }
            });
            
            let hitObjectsStringArray = hitObjectsString.split('\n');
            let tempNoteArray = [];

            hitObjectsStringArray.forEach(noteString => {
                if(noteString.length > 5){
                    let holder = noteString.split(',');
                    if(holder[3] == 1){
                        let tempOffset = holder[2];

                        let tempType = !(holder[4]==0 || holder[4]==4) ? 2 : 0;

                        tempNoteArray.push({offset: tempOffset, type: tempType});    
                    }
                }
            });


            let pushNoteArray = [];
            let uninheritedPoint = {};
            let inheritedPoint = {};
            //v2
            tempNoteArray.forEach(note => {
                // get timing points for this note
                uninheritedPoint = findUninheritedPointForNote(uninheritedArray, note.offset);
                inheritedPoint = findInheritedPointForNote(inheritedArray, note.offset, uninheritedPoint.offset);

                // set note properties
                let tempBpm = uninheritedPoint.bpm;
                
                let tempSv = inheritedPoint? inheritedPoint.sv : 1;
                let tempVolume = inheritedPoint? inheritedPoint.volume : 1;
                let tempNote = new Note(note.type, tempSv, tempBpm, note.offset, tempVolume);
                pushNoteArray.push(tempNote);
            });

            beatmapObj.noteArray = pushNoteArray;

            console.log("beatmapObj: ");
            console.log(beatmapObj);
        }

        function findUninheritedPointForNote(uninheritedArray, noteOffset) {
            let i = uninheritedArray.length-1;
            while(uninheritedArray[i].offset > noteOffset && i>0){ i--; }
            return uninheritedArray[i];
        }

        function findInheritedPointForNote(inheritedArray, noteOffset, unheritedOffset) {
            let i = inheritedArray.length-1;
            while(true){
                if(!inheritedArray[i]) return null;
                
                if(inheritedArray[i].offset > noteOffset){
                    i--;
                }
                else{
                    break;
                }
            }
            if(inheritedArray[i].offset >= unheritedOffset){
                return inheritedArray[i];
            } else return null;
        }



        function getBeatmapProperty(propertyString, beatmapString) {
            return beatmapString.split(propertyString)[1].trim().split("\n")[0];
        }
